ON} Current\npopd\npushd ${FRAMEWORK_DIR}\nln -s Versions/Current/Headers Headers\nln -s Versions/Current/Resources Resources\nln -s Versions/Current/${FRAMEWORK_NAME} ${FRAMEWORK_NAME}\npopd\n\n# Create the universal library\nlipo -create \\\n${SRCROOT}/build/${CONFIGURATION}-iphoneos/lib${PRODUCT_NAME}.a \\\n${SRCROOT}/build/${CONFIGURATION}-iphonesimulator/lib${PRODUCT_NAME}.a \\\n-output \"${FRAMEWORK_DIR}/Versions/Current/${PRODUCT_NAME}\"\n\n# Copy files\nHEADER=*.h\nls ${SRCROOT}/${PROJECT_NAME}/Headers/${HEADER} > /dev/null 2>&1 && cp ${SRCROOT}/${PROJECT_NAME}/Headers/${HEADER} ${FRAMEWORK_DIR}/Headers\ncp ${SRCROOT}/${PROJECT_NAME}/${INFO_PLIST} ${FRAMEWORK_DIR}/Resources\n\n# Create zip\ncd ${FRAMEWORK_BUILD_PATH}\nzip -ry ${FRAMEWORK_PACKAGE_NAME} $(basename $FRAMEWORK_DIR)\n";
